// import React, { useState, useEffect} from 'react';
// Bootstrap
import { Table } from 'react-bootstrap';
import { Container } from "react-bootstrap";
import {Ingredient} from "../types/types";
import {addIngredient} from "../redux/actions/actions";
import {connect} from "react-redux";

let xd = 0;
const ProductsList = ({ingredients, addIngredient}) => {
    if(ingredients[0] !== undefined){
        ingredients.forEach(xd =>{
            console.log(xd.payload.id + "jazda" + xd.payload.id);
            console.log(xd.payload.label);
            console.log(xd.payload.unit);
        })
        return(
            <Container>
                <Table striped bordered hover>
                    <thead>
                        <tr>
                            <th>xd</th>
                            <th>Amount of xyz</th>
                            <th>Delete</th>
                        </tr>
                    </thead>
                    <tbody>
                    {ingredients.map(ingredient => {
                        <tr>
                            <td>1</td>
                            <td key={ingredient.payload.id}>{ingredient.payload.label}</td>
                        </tr>
                    })
                    }
                    </tbody>
                </Table>
            </Container>

        )
    }

    return(
        <a>Your ingredient list is empty!</a>
    )
    }

export default connect(
    (state) => ({
        ingredients: state.ingredients.ingredientsList,
    }), {
        addIngredient: addIngredient
    }
)(ProductsList);
